dunes-script-module.script:
var resourceElementCategoryPath = "Library/SovLabs/Cache/F5";
var resourceElementName = "F5 Cache";
var resourceElement = null;

var resourceElementCategory = System.getModule("com.sovlabs.vra.utilities").getResourceElementCategoryFromPath(resourceElementCategoryPath);

if (resourceElementCategory !== null) {
	for each (var re in resourceElementCategory.allResourceElements) {
		if (re.name == resourceElementName) {
			resourceElement = re;
			break;
		}
	}
}

if (resourceElement !== null) {
	try {
		return JSON.parse(resourceElement.getContentAsMimeAttachment().content);
	} catch (e) {
	}
}

return "";
